/*
-- Query: select
ax_classic.spawn2.id + 300000 as id,
ax_classic.spawn2.spawngroupId + 300000 as spawngroupId,
ax_classic.spawn2.zone,
ax_classic.spawn2.version,
ax_classic.spawn2.x,
ax_classic.spawn2.y,
ax_classic.spawn2.z,
ax_classic.spawn2.heading,
ax_classic.spawn2.variance,
ax_classic.spawn2.pathgrid,
0 as _condition,
ax_classic.spawn2.cond_value,
ax_classic.spawn2.enabled,
'january_2005_paw_revamp' as content_flags_disabled
from ax_classic.npc_types
left join ax_classic.spawnentry on ax_classic.npc_types.id = ax_classic.spawnentry.npcID
left join ax_classic.spawngroup ON ax_classic.spawnentry.spawngroupID = ax_classic.spawngroup.id
left join ax_classic.spawn2 on ax_classic.spawnentry.spawngroupID = ax_classic.spawn2.spawngroupID
where ax_classic.npc_types.id >= 18000 and ax_classic.npc_types.id < 19000
and ax_classic.spawnentry.npcID is not null
and chance > 0
group by ax_classic.spawn2.id
order by ax_classic.spawn2.id
LIMIT 0, 1000

-- Date: 2022-01-24 11:50
*/
